DROP TABLE Unlockables;
CREATE TABLE Unlockables(
   CardID       INTEGER  NOT NULL 
  ,UnlockableID INTEGER  NOT NULL
  ,UnlockableCategory VARCHAR(40) NOT NULL
  ,UnlockableSubcategory VARCHAR(9) NOT NULL,
constraint unlock_pk1 primary key (UnlockableID,CardID),
constraint unlock_fk1 foreign key (CardID) references Cards(CardID)
);
